import { pagelinks } from "../pagelinks"

export default function PageLinks(props){
    return(
        <ul className="nav-links" id="nav-links">
        {pagelinks.map((data) => (
          <li key={data.id}>
            <a className="nav-link" href={data.href}>
              {data.text}
            </a>
          </li>
        ))}
      </ul>
    )
}
